import re
from Crypto.Util.Padding import pad
import base64
from pyDes import des, CBC, PAD_PKCS5
from Crypto.Cipher import AES
import json
from hashlib import md5


class PyCryptoAesDesMd5Base64:

    @staticmethod
    def add_16(par: str) -> str:
        par = par.encode('utf-8')
        while len(par) % 16 != 0:
            par += b'\x00'
        return par.decode('utf8')

    @staticmethod
    def add_to_16(s):
        while len(s) % 16 != 0:
            s += (16 - len(s) % 16) * chr(16 - len(s) % 16)
        return str.encode(s)  # 返回bytes

    @staticmethod
    def md5_encrypt_text(decrypt_text: str) -> str:
        """
        md5加密
        :param decrypt_text: 明文
        :return: 密文
        """
        return md5(decrypt_text.encode('utf8')).hexdigest()

    @staticmethod
    def base64_encrypt_text(decrypt_text: str) -> str:
        """
        Bse64加密
        :param decrypt_text: 明文
        :return: 密文
        """
        return base64.b64encode(decrypt_text.encode("utf-8")).decode()

    @staticmethod
    def base64_decrypt_text(encrypt_text: str) -> str:
        """
        Bse64解密
        :param encrypt_text: 密文
        :return: 明文
        """
        return base64.b64decode(encrypt_text).decode("utf-8")

    @staticmethod
    def des_cbc_encrypt_text(decrypt_text: str, key: str, iv: str) -> str:
        """
        加密DES_CBC明文
        :param decrypt_text: 明文
        :param key: 密钥
        :param iv: 密钥偏移量
        :return: 加密后的数据
        """
        des_obj = des(key[:8].encode('utf-8'), CBC, iv.encode('utf-8'),
                      pad=None, padmode=PAD_PKCS5)
        encrypt_text = des_obj.encrypt(decrypt_text)
        encrypt_text = str(base64.encodebytes(encrypt_text),
                           encoding='utf-8').replace("\n", "")
        return encrypt_text

    @staticmethod
    def des_cbc_decrypt_js_text(encrypt_text: str, key: str, iv: str) -> str:
        """
        解密DES_CBC密文
        :param encrypt_text: 密文
        :param key: 秘钥
        :param iv:秘钥便宜量
        :return:解密后的数据
        """
        decode_encrypt_text = base64.b64decode(encrypt_text)
        des_obj = des(key[:8].encode('utf-8'), CBC, iv.encode('utf-8'),
                      pad=None, padmode=PAD_PKCS5)
        decrypt_text = des_obj.decrypt(decode_encrypt_text,
                                       padmode=PAD_PKCS5).decode('utf8')
        return decrypt_text

    @staticmethod
    def aes_cbc_encrypt_text(decrypt_text: str, key: str, iv: str) -> str:
        """
        加密AES_CBC的明文
        :param decrypt_text: 明文
        :param key: 密钥
        :param iv: 密钥偏移量
        :return: 密文
        """
        aes2 = AES.new(key.encode('utf-8'), AES.MODE_CBC, iv.encode('utf-8'))
        encrypt_text = aes2.encrypt(pad(decrypt_text.encode('utf-8'), AES.block_size, style='pkcs7'))
        encrypt_text = str(base64.encodebytes(encrypt_text), encoding='utf-8').replace("\n", "")
        return encrypt_text

    @staticmethod
    def aes_cbc_decrypt_js_text(encrypt_text: str, key: str, iv: str) -> str:
        """
        解密AES_CBC的密文
        :param encrypt_text: 密文
        :param key: 密钥
        :param iv: 密钥偏移量
        :return:解密后的数据
        """
        decode_encrypt_text = base64.b64decode(encrypt_text)
        # 初始化AES对象时传入与加密时的相同的密钥、加密模式和iv
        aes2 = AES.new(key.encode('utf-8'), AES.MODE_CBC, iv.encode('utf-8'))
        decrypt_text = aes2.decrypt(decode_encrypt_text).decode('utf8')
        decrypt_text = decrypt_text.replace(b'\x00'.decode(), "").replace("", "")
        return decrypt_text

    @staticmethod
    def aes_ecb_encrypt_text(decrypt_text: str, key: str) -> str:
        """
        加密AES_ECB明文
        :param decrypt_text: 待加密的字符串
        :param key: 密钥
        :return:  加密后的数据
        """
        aes2 = AES.new(key.encode('utf-8'), AES.MODE_ECB)
        # encrypt_text = str(base64.encodebytes(aes2.encrypt(PyCryptoAesDesMd5Base64.add_to_16(decrypt_text))), encoding='utf8').replace('\n', '')  # 加密
        encrypt_text = aes2.encrypt(pad(decrypt_text.encode('utf-8'), AES.block_size, style='pkcs7'))
        encrypt_text = str(base64.encodebytes(encrypt_text), encoding='utf-8').replace("\n", "")
        return encrypt_text


